def TeLg(theta):
    """
    :param theta: the inertial angle in radians
    :return: the lifted left action matrix given the angle
    """
    arr = np.array([[cos(theta), -sin(theta), 0],
                    [sin(theta), cos(theta), 0],
                    [0, 0, 1]])
    return arr

