def M(theta, a1, a2, da1, da2):
    """
    :return: the 5 * 1 dv/dt matrix: xdot, ydot, thetadot, a1dot, a2dot
    """
    da = np.array([[da1],
                   [da2]])
    f = TeLg(theta) @ (J(a1, a2) @ da)
    xdot = f[0, 0]
    ydot = f[1, 0]
    thetadot = f[2, 0]
    M = [xdot, ydot, thetadot, da1, da2]
    return M


